import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { useNavigate } from '../../../node_modules/react-router/index';
import ChattingList from '../../components/ChattingList/ChattingList';
import { openChatting, requestChattingList } from '../../modules/chatting';

const ChattingListContainer = () => {
  const dispatch = useDispatch();
  const { chattingList } = useSelector(({ chatting: { chattingList } }) => ({
    chattingList,
  }));
  const navigate = useNavigate();
  useEffect(() => {
    if (!localStorage.user) navigate('/');
    const { uid } = JSON.parse(localStorage.user);

    dispatch(requestChattingList({ uid }));
  }, [dispatch, navigate]);

  const chatOn = () => {
    console.log('hi');
    dispatch(openChatting());
  };

  return <ChattingList chattingList={chattingList} chatOn={chatOn} />;
};

export default ChattingListContainer;
